// main contract

contract MaqueIco is Context, ReentrancyGuard {

        using SafeMath for uint256;
        using SafeERC20 for IERC20;

        // The token being sold
        IERC20 public token;

        // Address where funds are collected
        address payable public wallet;

        // How many token units a buyer gets per wei
        uint256 public rate;

        // Amount of wei raised
        uint256 public weiRaised;

        uint256 public tokenCap;

        uint256 public tokenSold;

        uint256 public tokenAvailable;

        address catoshi;

        mapping (address => uint256) private _contribution;

        event TokenPurchase(
            address indexed purchaser,
            address indexed beneficiary,
            uint256 value,
            uint256 amount
        );

        event PresaleEnded(address indexed admin, uint256 value);

        modifier onlyCatoshi(){
            require(catoshi == _msgSender(),"OnekoICO : You're Not Catoshi T_T");
            _;
        }

        constructor(uint256 _rate, address payable _wallet, IERC20 _token){
            require(_rate > 0, "OnekoICO : Rate should be higher than 0");
            require(_wallet != address(0), "OnekoICO : Error Wallet Zero");
            require(_token != IERC20(address(0)), "OnekoICO : Error Not ERC20 Token");

            rate = _rate;
            wallet = _wallet;
            token = _token;
            catoshi = _msgSender();
            tokenCap = 200000000000;
            tokenSold = 0;
        }

    //fallback() external payable{}

    receive() external payable{
        buyToken(msg.sender);
    }

    function buyToken(address _beneficiary) public payable nonReentrant{
        uint256 weiAmount = msg.value;

        _preValidatePurchase(_beneficiary, weiAmount);

        // calculate token amount to be created
        uint256 tokens = _getTokenAmount(weiAmount);

        // update state
        weiRaised = weiRaised.add(weiAmount);

        _processPurchase(_beneficiary, tokens);

        _updateContribution(_beneficiary, weiAmount);

        _forwardFunds(address(this).balance);
        //_postValidatePurchase(_beneficiary, weiAmount);

        //token.transfer(_beneficiary, tokens);

        tokenSold += weiAmount;

        emit TokenPurchase(
            msg.sender,
            _beneficiary,
            weiAmount,
            tokens
        );
    }

    // -----------------------------------------
    // Internal interface (extensible)
    // -----------------------------------------

    /**
    * @dev Validation of an incoming purchase. Use require statements to revert state when conditions are not met. Use super to concatenate validations.
    * @param _beneficiary Address performing the token purchase
    * @param _weiAmount Value in wei involved in the purchase
    */
    function _preValidatePurchase(
        address _beneficiary,
        uint256 _weiAmount
    )
        internal view virtual
    {
        require(_beneficiary != address(0),"OnekoICO : Beneficiary is zero address");
        require(_weiAmount != 0,"OnekoICO : Wei amount is zero");
        this;
    }

    /**
    * @dev Validation of an executed purchase. Observe state and use revert statements to undo rollback when valid conditions are not met.
    * @param _beneficiary Address performing the token purchase
    * @param _weiAmount Value in wei involved in the purchase
    */
    function _postValidatePurchase(
        address _beneficiary,
        uint256 _weiAmount
    )
        internal virtual
    {
        // optional override
        _contribution[_beneficiary] += _weiAmount;
    }

    /**
    * @dev Source of tokens. Override this method to modify the way in which the crowdsale ultimately gets and sends its tokens.
    * @param _beneficiary Address performing the token purchase
    * @param _tokenAmount Number of tokens to be emitted
    */
    function _deliverTokens(
        address _beneficiary,
        uint256 _tokenAmount
    )
        internal virtual
    {
        token.transfer(_beneficiary, _tokenAmount);
